import { Component, OnInit, Inject } from '@angular/core';
import { FormGroup, FormBuilder, Validators } from '@angular/forms';
import { ActivatedRoute, Router } from '@angular/router';
import * as jsPDF from 'jspdf';
import { UserService } from '../user/user.service';
import { MatSnackBar, MatDialogRef, MAT_DIALOG_DATA } from '@angular/material';

@Component({
  selector: 'app-bank-details',
  templateUrl: './bank-details.component.html',
  styleUrls: ['./bank-details.component.scss']
})
export class BankDetailsComponent implements OnInit {


  bankDetailsForm: FormGroup;
  user: string;
  voucher: any;

  constructor(
    private fb: FormBuilder,
    private activatedRoute: ActivatedRoute,
    private router: Router,
    private userService: UserService,
    private snackbar: MatSnackBar,
    private dialogref: MatDialogRef<BankDetailsComponent>,
    @Inject(MAT_DIALOG_DATA) private data: string,
  ) {
    this.user = this.data['user'];
    this.voucher = this.data['voucher'];
  }

  ngOnInit() {
    this.bankDetailsForm = this.fb.group({
      'user_name': ['', Validators.required],
      'bank_name': ['', Validators.required],
      'account_number': ['', Validators.required],
      'city': ['', Validators.required],
      'branch': ['', Validators.required],
      'ifsc': ['', Validators.required],
      'mobile': ['', Validators.required]
    });
  }

  submitBankDetails(bankDetailsForm) {
    this.userService.saveBankDetails(bankDetailsForm.value).subscribe(
      res => {
        if (res['code'] === 200) {
          this.downloadVoucherForWinner();
          this.router.navigate(['/home']);
          this.dialogref.close();
        } else {
          this.snackbar.open(
            `Something Went Wrong, 
            contact ashrama officials with your email and phone number  handy, or try to re-submit your bank details`,
            '' , {
              duration: 5000
            });
        }
      }
    );
  }



  downloadVoucherForWinner() {
    const doc = new jsPDF();
    const imgData = 'data:image/jpeg;base64,';


    doc.addImage(imgData, 'JPEG', 15, 40, 180, 160);
    doc.setFontSize(10);
    doc.setFont('times');
    doc.setTextColor('#ffffff');
    doc.text(168, 45, this.voucher);
    doc.setFontSize(22);
    doc.setFont('times');
    doc.setTextColor('#223657');
    doc.setFontType('italic');
    doc.text(98, 129, this.user);
    doc.output('datauri');
    doc.save('rkm_voucher.pdf');
  }

}
